import react, {useContext, useEffect, useState } from "react";
import Title from "./Title";
import ListItem from "./NotesList/NotesItem";
import Note_book from "./buttons/notebook";
import LogOut from "./buttons/logout";
import { useLocation } from "react-router-dom";
import axios from "axios";
import { nameContext } from "../context/context";
import { get } from "mongoose";

function Profile_page(){
    const value = useContext(nameContext);
   // const location = useLocation();
    // fetch(url,{method: , header: , bady: })

  useEffect(() => {
    fetch('http://localhost:3001/profile', {
        method: "POST",
        body: JSON.stringify({ username: value.name })
    })
    .then(res => res.json())
    .then(data => value.setName(data.username));
}, [])
return(
    <div>
        <div className="TitleBar">
            <div>
            <Title/>
            </div>
            <div className="buttonBox">
                <Note_book/> 
                <LogOut/>
            </div>
        
        </div>
            <div className="NoteListContainer">
                <ListItem date = "22 April 2024" title = {value.name}></ListItem>
            </div>
            
    </div>
    );
}

export default Profile_page;
